import React from 'react';
import './Exchanger.scss';
import {Input} from "./Input"


class Exchanger extends React.Component {
  constructor(props) {
    super (props);
  }

  render () {
    return (
        <fieldset className="app-exchanger">
            <legend className="USD">Enter currency in $, USD</legend>
            <label for="USD">USD</label>
            <Input id="USD" placeholder="USD">ghfhg</Input>
            <Input id="BYN" placeholder="BYN"></Input>
        </fieldset>
    );
  }
}


export {Exchanger};
